import React from 'react'
import todos from './TodoData'
import TodoItems from './TodoItems';


function App(){
    const myTodos = todos.map(todo=><TodoItems name={todo.name} completed={todo.completed} key={todo.id}/>)
    return(
        <div>
            {myTodos}
        </div>
    )
}

export default App;
